import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Paper from "@material-ui/core/Paper";

import PleaseWork from "./PleaseWork";
import PleaseWork2 from "./PleaseWork2";

import TeamMemberAssiClTable from "./teamMemberAssiClTable";

import TeamMemFilesTable from "./Tables/teamMemFilesTable";
import ClientInfoBoxes from "./clientInfoBoxes";
import ClientPayorInfoBoxes from "./clientPayorInfoBoxes";
import AsiTherpaistsTable from "./Tables/asiTherpaistsTable";

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: 24 }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired
};

const styles = theme => ({
  root: {
    //flexGrow: 1,
    //backgroundColor: theme.palette.background.paper,
    marginLeft: theme.spacing.unit * 22,
    marginRight: theme.spacing.unit * 22,
    width: 1020
  }
});
class SimpleTabs extends React.Component {
  state = {
    value: 0
  };

  handleChange = (event, value) => {
    this.setState({ value });
  };

  render() {
    const { classes } = this.props;
    const { value } = this.state;

    return (
      <div className={classes.root}>
        <AppBar position="static">
          <Tabs value={value} onChange={this.handleChange}>
            <Tab label="Client Information" />
            <Tab label="Payor Information" />
            <Tab label="Message History" />
            <Tab label="Files" />
            <Tab label="Assigned Therapists" />
          </Tabs>
        </AppBar>

        {value === 0 && <ClientInfoBoxes />}
        {value === 0 && <PleaseWork2 />}
        {value === 1 && <ClientPayorInfoBoxes />}
        {value === 2 && <TabContainer>Message History</TabContainer>}
        {value === 3 && <TeamMemFilesTable />}
        {value === 4 && <AsiTherpaistsTable />}
      </div>
    );
  }
}

SimpleTabs.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(SimpleTabs);
